■商品内容<br>
サイズ：サイズ：約3mm　ホール：約1mm　<br>
カラー：写真をご参考ください。<br>
素材：ガラス<br>
※ガラス製のため、無理な負荷をかけますと破損する場合がございます。ご注意下さい。<br>
数量：5g（約160個前後）<br>
※量り売りの為個数には誤差がございます。あくまで目安としてお考え下さい。<br>
また、形のいびつな物や、欠けているものなどが含まれた重さです。予めご了承ください。<br>
※ケースは付属いたしません。袋に入れての発送となります。<br>
<br>
■スタッフより一言♪<br>
ハンドメイドアクセサリーや刺しゅうにおすすめのシードビーズです。<br>秋冬のアクセサリーに合わせやすいメタリックカラーは作品のアクセントに♪<br>ピアスやネックレス、ブレスレット、ブローチなど幅広くお使いいただけます。<br><br>
