■商品内容<br>
サイズ：約8ミリ（±0.5ミリ）ホール：約1.5ミリ<br>
　　　　約6ミリ（±0.5ミリ）ホール：約1ミリ<br>
　　　　約4ミリ（±1.5ミリ）ホール：約1ミリ<br>
※一粒ずつ手作業での加工のためサイズには個体差がございます。ご了承ください。<br>
カラー 　写真をご参考ください。<br>
※写真では光を強く当てて撮影しております。<br>
素材：ガラス<br>
数量：8ミリ…1粒<br>
　　　6ミリ…2粒<br>
　　　4ミリ…3粒<br><br>
■スタッフより一言♪<br>
まるで満天の星空を詰め込んだ小さな宇宙のようなロマンチックな輝きのブルーゴールドストーンのビーズです。<br>角度によってラメの輝き方が違い、まさに夜空のような不思議な魅力を持っています。<br>その美しさから人工のパワーストーンとしても親しまれているほどです。<br>カット加工が施されているのでさらにその魅力を引き立ててくれます。<br>サイズも8～4ミリのアクセサリーに使いやすい大きさです。<br>ぜひその不思議な輝きをお楽しみください。<br>
<br>
※ラメの輝きには個体差がございます。予めご了承ください。<br>
※こちらはガラスで作られた人工石です。天然石ではございません。<br>
※加工時に付いた傷やヒビなどのある状態の商品が含まれる場合がございます。ご了承下さい。<style type="text/css">
